  false,\n\t\"url\": null,\n\t\"notes\": \"The Union Slough National Wildlife Refuge
  Habitat Management Plan provides a long-term vision and specific guidance on managing
  habitats for the resources of concern at Union Slough National Wildlife Refuge,
  to facilitate continuity in management programs. Refuge background, resources of
  concern, and habitat management goals and objectives are discussed. Management strategies
  and prescriptions then identify how and the specific means by which management and
  monitoring strategies will be implemented.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
